import React from "react";
import { withAreaConsumer } from "../../context";
import AreasList from "../areas-list";

function AreaContainer({ context }) {
  const { areas } = context;
  return (
    <>
      <AreasList areas={areas} />
    </>
  );
}

export default withAreaConsumer(AreaContainer);

